import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="homepage">

      <h2>Share and improve your code with the community</h2>
      <p>This is a platform where you can share your code snippets that you don't understand and get help from the community to improve and correct them.</p>
      <Link to="/blog">
        <button>Read More</button>
      </Link>
    </div>
  );
};

export default HomePage;
